    public int maxProduct(int[] A) {
        if (A == null || A.length == 0) {
            return 0;
        }
        
        return getMax(A, 0, A.length);
    }
    
    private int getMax(int[] A, int start, int length) {
        if (length <= 2) {
            return A[start];
        }
        
        int halfSize = length / 2;
        int leftMax = getMax(A, start, halfSize);
        int middleMax = getMiddleMax(A, start, start + length - 1, (length - 1) / 2);
        int rightMax = getMax(A, start + halfSize, length - halfSize);
        
        return getTripleMax(leftMax, middleMax, rightMax);
    }
    
    private int getMiddleMax(int[] A, int start, int end, int mid) {
        int leftMax = Integer.MIN_VALUE;
        int rightMax = Integer.MIN_VALUE;
        
        int leftProduct = A[mid];
        for (int i = mid - 1; i >= start; i--) {
            leftProduct *= A[i];
            if (leftProduct > leftMax) {
                leftMax = leftProduct;
            }
            if (leftProduct == 0) {
                break;
            }
        }
        
        int rightProduct = A[mid + 1];
        for (int i = mid + 2; i <= end; i++) {
            rightProduct *= A[i];
            if (rightProduct > rightMax) {
                rightMax = rightProduct;
            }
            if (rightProduct == 0) {
                break;
            }
        }
        
        return leftMax * rightMax;
        
    }
    
    private int getTripleMax(int a, int b, int c) {
        if (a >= b && a >= c) {
            return a;
        } else if (b >= a && b >= c) {
            return b;
        } else {
            return c;
        }
    }

